import { createWebHistory, createRouter } from 'vue-router'
import Main from './components/Main'
import GameDetails from './pages/GameMain'


const routes = [
  { path: '/', component: Main, name: Main },
  { path: '/login', component: Login, name: GameDetails },
  { path: '/userlanding', component: User, name: User },
  { path: '/game', component: GameMain, name: Game },
  // { path: '/watchlist', component: WatchList, name: Watchlist }
]

const router = createRouter({
  history: createWebHistory(),
  routes
})

export default router
